n": {"rules": [{"apply_server_side_encryption_by_default": {"sse_algorithm": "AES256"}}]}}}}], "edges": [{"from": "cloudfront_distribution", "to": "api_gateway", "label": "routes to"}, {"from": "api_gateway", "to": "ecs_service", "label": "integrates with"}, {"from": "ecs_service", "to": "rds_instance", "label": "connects to"}, {"from": "route53_record", "to": "cloudfront_distribution", "label": "points to"}, {"from": "rds_instance", "to": "s3_backup_bucket", "label": "backs up to"}]}, "terraform_files": {"files": {"main.tf": "locals {
  project_name = "infra-"
  common_tags = {
    Project = local.project_name
    Environment = "production"
  }
}

terraform {
  required_version = ">= 1.0"
  required_providers {
    aws = {
      source  = "hashicorp/aws"
      version = ">= 4.0"
    }
  }
}", "variables.tf": "variable "aws_region" {
  type        = string
  default     = "us-east-1"
  description = "AWS region"
}

variable "project_name" {
  type        = string
  default     = "infra-"
  description = "Project name prefix"
}

variable "vpc_cidr_block" {
  type        = string
  default     = "10.0.0.0/16"
  description = "VPC CIDR block"
}

variable "ecs_instance_type" {
  type        = string
  default     = "t3.medium"
  description = "ECS instance type"
}

variable "rds_instance_class" {
  type        = string
  default     = "db.r6g.xlarge"
  description = "RDS instance class"
}

variable "rds_engine" {
  type        = string
  default     = "postgres"
  description = "RDS engine"
}

variable "rds_allocated_storage" {
  type        = number
  default     = 100
  description = "RDS allocated storage"
}

variable "route53_zone_id" {
  type        = string
  description = "Route53 zone ID"
}", "outputs.tf": "output "api_gateway_url" {
  value = aws_apigatewayv2_api.api_gateway.api_endpoint
}

output "cloudfront_domain" {
  value = aws_cloudfront_distribution.cloudfront_distribution.domain_name
}

output "rds_endpoint" {
  value = aws_db_instance.rds_instance.endpoint
}

output "ecs_cluster_name" {
  value = aws_ecs_cluster.ecs_cluster.name
}", "provider.tf": "provider "aws" {
  region = var.aws_region
}", "networking.tf": "resource "aws_vpc" "vpc" {
  cidr_block = var.vpc_cidr_block
  tags       = merge(local.common_tags, { Name = "${var.project_name}vpc" })
}

resource "aws_internet_gateway" "igw" {
  vpc_id = aws_vpc.vpc.id
  tags   = merge(local.common_tags, { Name = "${var.project_name}igw" })
}

resource "aws_subnet" "public_subnet_1" {
  vpc_id            = aws_vpc.vpc.id
  cidr_block        = cidrsubnet(aws_vpc.vpc.cidr_block, 8, 1)
  availability_zone = "${var.aws_region}a"
  tags              = merge(local.common_tags, { Name = "${var.project_name}public-subnet-1" })
}

resource "aws_subnet" "public_subnet_2" {
  vpc_id            = aws_vpc.vpc.id
  cidr_block        = cidrsubnet(aws_vpc.vpc.cidr_block, 8, 2)
  availability_zone = "${var.aws_region}b"
  tags              = merge(local.common_tags, { Name = "${var.project_name}public-subnet-2" })
}

resource "aws_subnet" "private_subnet_1" {
  vpc_id            = aws_vpc.vpc.id
  cidr_block        = cidrsubnet(aws_vpc.vpc.cidridr_block, 8, 3)
  availability_zone = "${var.aws_region}a"
  tags              = merge(local.common_tags, { Name = "${var.project_name}private-subnet-1" })
}

resource "aws_subnet" "private_subnet_2" {
  vpc_id            = aws_vpc.vpc.id
  cidr_block        = cidrsubnet(aws_vpc.vpc.cidr_block, 8, 4)
  availability_zone = "${var.aws_region}b"
  tags              = merge(local.common_tags, { Name = "${var.project_name}private-subnet-2" })
}

resource "aws_eip" "nat_eip" {
  domain = "vpc"
}

resource "aws_nat_gateway" "nat_gw" {
  allocation_id = aws_eip.nat_eip.id
  subnet_id     = aws_subnet.public_subnet_1.id
  tags          = merge(local.common_tags, { Name = "${var.project_name}nat-gw" })
}", "security_groups.tf": "resource "aws_security_group" "ecs_sg" {
  name        = "${var.project_name}ecs-sg"
  description = "ECS security group"
  vpc_id      = aws_vpc.vpc.id

  dynamic "ingress" {
    for_each = [
      {
        from_port   = 80
        to_port     = 80
        protocol    = "tcp"
        cidr_blocks = ["0.0.0.0/0"]
      }
    ]
    content {
      from_port   = ingress.value.from_port
      to_port     = ingress.value.to_port
      protocol    = ingress.value.protocol
      cidr_blocks = ingress.value.cidr_blocks
    }
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }

  tags = merge(local.common_tags, { Name = "${var.project_name}ecs-sg" })
}

resource "aws_security_group" "rds_sg" {
  name        = "${var.project_name}rds-sg"
  description = "RDS security group"
  vpc_id      = aws_vpc.vpc.id

  ingress {
    from_port       = 5432
    to_port         = 5432
    protocol        = "tcp"
    security_groups = [aws_security_group.ecs_sg.id]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }

  tags = merge(local.common_tags, { Name = "${var.project_name}rds-sg" })
}", "ecs.tf": "resource "aws_ecs_cluster" "ecs_cluster" {
  name = "${var.project_name}ecs-cluster"
  tags = merge(local.common_tags, { Name = "${var.project_name}ecs-cluster" })
}

resource "aws_iam_role" "ecs_task_role" {
  name        = "${var.project_name}ecs-task-role"
  description = "ECS task execution role"

  assume_role_policy = jsonencode({
    Version = "2012-10-17"
    Statement = [
      {
        Action = "sts:AssumeRole"
        Effect = "Allow"
        Principal = {
          Service = "ecs-tasks.amazonaws.com"
        }
      }
    ]
  })

  tags = merge(local.common_tags, { Name = "${var.project_name}ecs-task-role" })
}

resource "aws_iam_role_policy_attachment" "ecs_task_policy_attach" {
  role       = aws_iam_role.ecs_task_role.name
  policy_arn = "arn:aws:iam::aws:policy/service-role/AmazonECSTaskExecutionRolePolicy"
}

resource "aws_ecs_task_definition" "ecs_task_def" {
  family                   = "${var.project_name}ecs-task-def"
  cpu                      = 1024
  memory                   = 512
  network_mode             = "awsvpc"
  requires_compatibilities = ["FARGATE"]
  execution_role_arn       = aws_iam_role.ecs_task_role.arn

  container_definitions = jsonencode([
    {
      name        = "fastapi"
      image       = "public.ecr.aws/docker/library/python:3.11-slim"
      cpu         = 0
      essential   = true
      portMappings = [
        {
          containerPort = 80
          hostPort      = 80
          protocol      = "tcp"
        }
      ]
    }
  ])
}

resource "aws_ecs_service" "ecs_service" {
  name            = "${var.project_name}ecs-service"
  cluster         = aws_ecs_cluster.ecs_cluster.name
  task_definition = aws_ecs_task_definition.ecs_task_def.arn
  launch_type      = "FARGATE"
  desired_count   = 1

  network_configuration {
    security_groups  = [aws_security_group.ecs_sg.id]
    subnets          = [aws_subnet.private_subnet_1.id, aws_subnet.private_subnet_2.id]
    assign_public_ip = true
  }
}", "rds.tf": "resource "aws_db_instance" "rds_instance" {
  identifier           = "${var.project_name}rds-instance"
  instance_class       = var.rds_instance_class
  engine               = var.rds_engine
  allocated_storage    = var.rds_allocated_storage
  storage_type         = "gp3"
  multi_az             = true
  vpc_security_group_ids = [aws_security_group.rds_sg.id]
  db_subnet_group_name = aws_db_subnet_group.rds_subnet_group.name
  skip_final_snapshot  = true
  tags                 = merge(local.common_tags, { Name = "${var.project_name}rds-instance" })
}

resource "aws_db_subnet_group" "rds_subnet_group" {
  name        = "${var.project_name}rds-subnet-group"
  description = "RDS subnet group"
  subnet_ids  = [aws_subnet.private_subnet_1.id, aws_subnet.private_subnet_2.id]
  tags        = merge(local.common_tags, { Name = "${var.project_name}rds-subnet-group" })
}", "apigateway.tf": "resource "aws_apigatewayv2_api" "api_gateway" {
  name          = "${var.project_name}api-gateway"
  protocol_type = "HTTP"
  cors_configuration {
    allow_headers = ["content-type"]
    allow_origins  = ["*"]
    allow_methods  = ["*"]
  }
  tags = merge(local.common_tags, { Name = "${var.project_name}api-gateway" })
}

resource "aws_apigatewayv2_integration" "api_integration" {
  api_id = aws_apigatewayv2_api.api_gateway.id
  integration_type = "HTTP_PROXY"
  integration_method = "ANY"
  integration_uri = "http://${aws_lb.nlb.dns_name}"
}

resource "aws_apigatewayv2_route" "api_route" {
  api_id = aws_apigatewayv2_api.api_gateway.id
  route_key = "ANY /{proxy+}"
  target    = aws_apigatewayv2_integration.api_integration.id
}", "cloudfront.tf": "resource "aws_cloudfront_distribution" "cloudfront_distribution" {
  origin {
    domain_name = aws_apigatewayv2_api.api_gateway.api_endpoint
    origin_id   = "${var.project_name}api-gateway"
    custom_origin_config {
      http_port              = 80
      https_port             = 443
      origin_protocol_policy = "https-only"
      origin_ssl_protocols  = ["TLSv1.2"]
    }
  }
  enabled             = true
  is_ipv6_enabled     = true
  default_cache_behavior {
    allowed_methods  = ["DELETE", "GET", "HEAD", "OPTIONS", "PATCH", "POST", "PUT"]
    cached_methods   = ["GET", "HEAD"]
    target_origin_id = "${var.project_name}api-gateway"
    viewer_protocol_policy = "redirect-to-https"
  }
  restrictions {
    geo_restriction {
      restriction_type = "none"
    }
  }
  viewer_certificate {
    cloudfront_default_certificate = true
  }
  tags = merge(local.common_tags, { Name = "${var.project_name}cloudfront-distribution" })
}", "route53.tf": "resource "aws_route53_record" "route53_record" {
  zone_id = var.route53_zone_id
  name    = "api.example.com"
  type    = "A"
  alias {
    name                   = aws_cloudfront_distribution.cloudfront_distribution.domain_name
    zone_id               = aws_cloudfront_distribution.cloudfront_distribution.hosted_zone_id
    evaluate_target_health = false
  }
}", "s3.tf": "resource "aws_s3_bucket" "s3_backup_bucket" {
  bucket = "${var.project_name}s3-backup-bucket"
  tags   = merge(local.common_tags, { Name = "${var.project_name}s3-backup-bucket" })
}

resource "aws_s3_bucket_versioning" "s3_backup_bucket_versioning" {
  bucket = aws_s3_bucket.s3_backup_bucket.id
  versioning_configuration {
    status = "Enabled"
  }
}

resource "aws_s3_bucket_server_side_encryption_configuration" "s3_backup_bucket_encryption" {
  bucket = aws_s3_bucket.s3_backup_bucket.id
  rule {
    apply_server_side_encryption_by_default {
      sse_algorithm = "AES256"
    }
  }
