"desired_count": 3}}}, {"id": "ecs_iam_role", "type": "aws_iam_role", "label": "ECS Task Role", "config": {"runtime": null, "memory": null, "instance_type": null, "engine": null, "capacity": null, "extra": {"policies": ["arn:aws:iam::aws:policy/service-role/AmazonECSTaskExecutionRolePolicy"]}}}, {"id": "rds_instance", "type": "aws_rds", "label": "PostgreSQL RDS Instance", "config": {"runtime": null, "memory": null, "instance_type": "db.r6g.large", "engine": "postgres", "capacity": null, "extra": {"storage_type": "gp3", "provisioned_iops": 3000, "multi_az": true}}}, {"id": "elasticache_cluster", "type": "aws_elasticache", "label": "ElastiCache Redis Cluster", "config": {"runtime": null, "memory": null, "instance_type": "cache.r6g.large", "engine": "redis", "capacity": null, "extra": {"num_cache_nodes": 2, "engine_version": "7.0", "snapshot_window": "03:00-04:00", "snapshot_retention_limit": 7}}}, {"id": "rds_security_group", "type": "aws_security_group", "label": "RDS Security Group", "config": {"runtime": null, "memory": null, "instance_type": null, "engine": null, "capacity": null, "extra": {"ingress": [{"from_port": 5432, "to_port": 5432, "protocol": "tcp", "security_groups": ["${security_group.id}"]}]}}}, {"id": "elasticache_security_group", "type": "aws_security_group", "label": "ElastiCache Security Group", "config": {"runtime": null, "memory": null, "instance_type": null, "engine": null, "capacity": null, "extra": {"ingress": [{"from_port": 6379, "to_port": 6379, "protocol": "tcp", "security_groups": ["${security_group.id}"]}]}}}, {"id": "dynamodb_table", "type": "aws_dynamodb", "label": "Backup DynamoDB Table", "config": {"runtime": null, "memory": null, "instance_type": null, "engine": null, "capacity": {"read": 5, "write": 5}, "extra": {"billing_mode": "PROVISIONED", "point_in_time_recovery": true}}}], "edges": [{"from": "cloudfront_distribution", "to": "api_gateway", "label": "routes to"}, {"from": "api_gateway", "to": "ecs_cluster", "label": "routes to"}, {"from": "ecs_cluster", "to": "elasticache_cluster", "label": "connects to"}, {"from": "ecs_cluster", "to": "rds_instance", "label": "connects to"}, {"from": "ecs_cluster", "to": "dynamodb_table", "label": "writes backup to"}, {"from": "ecs_cluster", "to": "ecs_iam_role", "label": "assumes"}, {"from": "vpc", "to": "ecs_cluster", "label": "contains"}, {"from": "vpc", "to": "rds_instance", "label": "contains"}, {"from": "vpc", "to": "elasticache_cluster", "label": "contains"}, {"from": "security_group", "to": "ecs_cluster", "label": "applied to"}, {"from": "rds_security_group", "to": "rds_instance", "label": "applied to"}, {"from": "elasticache_security_group", "to": "elasticache_cluster", "label": "applied to"}]}, "terraform_files": {"files": {"main.tf": "locals {
  project_name = "S3 setup"
  common_tags = {
    Project = local.project_name
    ManagedBy = "Terraform"
  }
}

terraform {
  required_version = ">= 1.0"
  required_providers {
    aws = {
      source  = "hashicorp/aws"
      version = ">= 4.0"
    }
  }
}", "variables.tf": "variable "aws_region" {
  type        = string
  default     = "us-east-1"
  description = "AWS region"
}

variable "vpc_cidr_block" {
  type        = string
  default     = "10.0.0.0/16"
  description = "VPC CIDR block"
}

variable "instance_type" {
  type        = string
  default     = "db.r6g.large"
  description = "RDS instance type"
}

variable "elasticache_instance_type" {
  type        = string
  default     = "cache.r6g.large"
  description = "ElastiCache instance type"
}

variable "ecs_desired_count" {
  type        = number
  default     = 3
  description = "ECS desired count"
}

variable "dynamodb_read_capacity" {
  type        = number
  default     = 5
  description = "DynamoDB read capacity"
}

variable "dynamodb_write_capacity" {
  type        = number
  default     = 5
  description = "DynamoDB write capacity"
}", "outputs.tf": "output "api_gateway_url" {
  value = aws_apigatewayv2_api.api_gateway.api_endpoint
}

output "cloudfront_distribution_domain_name" {
  value = aws_cloudfront_distribution.cloudfront_distribution.domain_name
}

output "rds_instance_endpoint" {
  value = aws_db_instance.rds_instance.endpoint
}

output "elasticache_cluster_endpoint" {
  value = aws_elasticache_cluster.elasticache_cluster.cache_nodes[0].address
}

output "dynamodb_table_name" {
  value = aws_dynamodb_table.dynamodb_table.name
}", "provider.tf": "provider "aws" {
  region = var.aws_region
}", "networking.tf": "resource "aws_vpc" "vpc" {
  cidr_block = var.vpc_cidr_block
  tags       = local.common_tags
}

resource "aws_subnet" "public_subnet" {
  count             = 2
  vpc_id            = aws_vpc.vpc.id
  cidr_block        = cidrsubnet(aws_vpc.vpc.cidr_block, 8, count.index)
  availability_zone = element(["us-east-1a", "us-east-1b"], count.index)
  map_public_ip_on_launch = true
  tags              = local.common_tags
}

resource "aws_subnet" "private_subnet" {
  count             = 2
  vpc_id            = aws_vpc.vpc.id
  cidr_block        = cidrsubnet(aws_vpc.vpc.cidr_block, 8, count.index + 2)
  availability_zone = element(["us-east-1a", "us-east-1b"], count.index)
  tags              = local.common_tags
}

resource "aws_internet_gateway" "igw" {
  vpc_id = aws_vpc.vpc.id
  tags   = local.common_tags
}

resource "aws_eip" "nat_eip" {
  domain = "vpc"
}

resource "aws_nat_gateway" "nat_gw" {
  allocation_id = aws_eip.nat_eip.id
  subnet_id     = aws_subnet.public_subnet[0].id
  tags          = local.common_tags
}

resource "aws_route_table" "public_rt" {
  vpc_id = aws_vpc.vpc.id
  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.igw.id
  }
  tags = local.common_tags
}

resource "aws_route_table" "private_rt" {
  vpc_id = aws_vpc.vpc.id
  route {
    cidr_block = "0.0.0.0/0"
    nat_gateway_id = aws_nat_gateway.nat_gw.id
  }
  tags = local.common_tags
}

resource "aws_route_table_association" "public_rta" {
  count          = 2
  subnet_id      = aws_subnet.public_subnet[count.index].id
  route_table_id = aws_route_table.public_rt.id
}

resource "aws_route_table_association" "private_rta" {
  count          = 2
  subnet_id      = aws_subnet.private_subnet[count.index].id
  route_table_id = aws_route_table.private_rt.id
}

resource "aws_security_group" "security_group" {
  name        = "${local.project_name}-sg"
  description = "Security group for ${local.project_name}"
  vpc_id      = aws_vpc.vpc.id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
  tags = local.common_tags
}

resource "aws_security_group" "rds_security_group" {
  name        = "${local.project_name}-rds-sg"
  description = "Security group for RDS"
  vpc_id      = aws_vpc.vpc.id

  ingress {
    from_port       = 5432
    to_port         = 5432
    protocol        = "tcp"
    security_groups = [aws_security_group.security_group.id]
  }
  tags = local.common_tags
}

resource "aws_security_group" "elasticache_security_group" {
  name        = "${local.project_name}-elasticache-sg"
  description = "Security group for ElastiCache"
  vpc_id      = aws_vpc.vpc.id

  ingress {
    from_port       = 6379
    to_port         = 6379
    protocol        = "tcp"
    security_groups = [aws_security_group.security_group.id]
  }
  tags = local.common_tags
}", "api_gateway.tf": "resource "aws_apigatewayv2_api" "api_gateway" {
  name          = "${local.project_name}-api"
  protocol_type = "HTTP"
  cors_configuration {
    allow_headers = ["content-type"]
    allow_methods = ["GET, POST, PUT, DELETE"]
    allow_origins = ["*"]
  }
}

resource "aws_apigatewayv2_integration" "api_gateway_integration" {
  api_id = aws_apigatewayv2_api.api_gateway.id
  integration_type = "HTTP_PROXY"
  integration_method = "ANY"
  integration_uri = "http://${aws_lb.ecs_lb.dns_name}:8000"
}

resource "aws_apigatewayv2_route" "api_gateway_route" {
  api_id = aws_apigatewayv2_api.api_gateway.id
  route_key = "$default"
  target    = aws_apigatewayv2_integration.api_gateway_integration.id
}", "cloudfront.tf": "resource "aws_cloudfront_distribution" "cloudfront_distribution" {
  origin {
    domain_name = "${aws_apigatewayv2_api.api_gateway.id}.execute-api.${var.aws_region}.amazonaws.com"
    origin_id   = aws_apigatewayv2_api.api_gateway.id
  }

  default_cache_behavior {
    target_origin_id = aws_apigatewayv2_api.api_gateway.id
    viewer_protocol_policy = "redirect-to-https"
  }

  enabled = true
  aliases = []
  restrictions {
    geo_restriction {
      restriction_type = "none"
    }
  }
  viewer_certificate {
    cloudfront_default_certificate = true
  }
}", "ecs.tf": "resource "aws_ecs_cluster" "ecs_cluster" {
  name = "${local.project_name}-ecs-cluster"
}

resource "aws_ecs_task_definition" "ecs_task_definition" {
  family                = "${local.project_name}-task"
  cpu                    = 512
  memory                = 1024
  network_mode          = "awsvpc"
  requires_compatibilities = ["FARGATE"]
  execution_role_arn    = aws_iam_role.ecs_iam_role.arn
  container_definitions = jsonencode([
    {
      name        = "${local.project_name}-container"
      image       = "123456789012.dkr.ecr.us-east-1.amazonaws.com/fastapi:latest"
      portMappings = [
        {
          containerPort = 8000
          hostPort      = 8000
          protocol      = "tcp"
        }
      ]
    }
  ])
}

resource "aws_ecs_service" "ecs_service" {
  name            = "${local.project_name}-ecs-service"
  cluster         = aws_ecs_cluster.ecs_cluster.name
  task_definition = aws_ecs_task_definition.ecs_task_definition.arn
  launch_type      = "FARGATE"
  desired_count   = var.ecs_desired_count
  network_configuration {
    security_groups = [aws_security_group.security_group.id]
    subnets         = aws_subnet.private_subnet[*].id
    assign_public_ip = "ENABLED"
  }
}

resource "aws_lb" "ecs_lb" {
  name               = "${local.project_name}-ecs-lb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.security_group.id]
  subnets            = aws_subnet.public_subnet[*].id
}

resource "aws_lb_target_group" "ecs_tg" {
  name        = "${local.project_name}-ecs-tg"
  port        = 8000
  protocol    = "HTTP"
  vpc_id      = aws_vpc.vpc.id
  target_type = "ip"
}

resource "aws_lb_listener" "ecs_listener" {
  load_balancer_arn = aws_lb.ecs_lb.arn
  port              = 80
  protocol          = "HTTP"
  default_action {
    target_group_arn = aws_lb_target_group.ecs_tg.arn
    type             = "forward"
  }
}", "iam.tf": "resource "aws_iam_role" "ecs_iam_role" {
  name        = "${local.project_name}-ecs-task-execution-role"
  description = "ECS task execution role"

  assume_role_policy = jsonencode({
    Version = "2012-10-17"
    Statement = [
      {
        Action = "sts:AssumeRole"
        Effect = "Allow"
        Principal = {
          Service = "ecs-tasks.amazonaws.com"
        }
      }
    ]
  })
}

resource "aws_iam_policy" "ecs_task_execution_policy" {
  name        = "${local.project_name}-ecs-task-execution-policy"
  description = "Policy for ECS task execution"

  policy = jsonencode({
    Version = "2012-10-17"
    Statement = [
      {
        Action = [
          "ecr:GetAuthorizationToken",
          "ecr:BatchGetImage",
          "ecr:GetDownloadUrlForLayer",
          "logs:CreateLogStream",
          "logs:PutLogEvents"
        ]
        Effect = "Allow"
        Resource = "*"
      }
    ]
  })
}

resource "aws_iam_role_policy_attachment" "ecs_task_execution_attach" {
  role       = aws_iam_role.ecs_iam_role.name
  policy_arn = aws_iam_policy.ecs_task_execution_policy.arn
}", "rds.tf": "resource "aws_db_instance" "rds_instance" {
  identifier           = "${local.project_name}-rds-instance"
  instance_class       = var.instance_type
  engine               = "postgres"
  username             = "postgres"
  password             = "postgres"
  vpc_security_group_ids = [aws_security_group.rds_security_group.id]
  db_subnet_group_name = aws_db_subnet_group.rds_subnet_group.name
  skip_final_snapshot  = true
}

resource "aws_db_subnet_group" "rds_subnet_group" {
  name        = "${local.project_name}-rds-subnet-group"
  description = "RDS subnet group"
  subnet_ids  = aws_subnet.private_subnet[*].id
}", "elasticache.tf": "resource "aws_elasticache_cluster" "elasticache_cluster" {
  cluster_id           = "${local.project_name}-elasticache-cluster"
  engine               = "redis"
  node_type            = var.elasticache_instance_type
  num_cache_nodes     = 2
  parameter_group_name = "default.redis7"
  engine_version       = "7.0"
  port                 = 6379
  security_group_ids  = [aws_security_group.elasticache_security_group.id]
  subnet_group_name   = aws_elasticache_subnet_group.elasticache_subnet_group.name
  snapshot_window      = "03:00-04:00"
  snapshot_retention_limit = 7
}

resource "aws_elasticache_subnet_group" "elasticache_subnet_group" {
  name        = "${local.project_name}-elasticache-subnet-group"
  description = "ElastiCache subnet group"
  subnet_ids  = aws_subnet.private_subnet[*].id
}", "dynamodb.tf": "resource "aws_dynamodb_table" "dynamodb_table" {
  name           = "${local.project_name}-dynamodb-table"
  billing_mode   = "PROVISIONED"
  read_capacity  = var.dynamodb_read_capacity
  write_capacity = var.dynamodb_write_capacity
  hash_key       = "id"

  attribute {
    name = "id"
    type = "S"
  }
  point_in_time_recovery {
    enabled = true
  }
